import React from 'react';
import logo from './logo.svg';
import './App.css';
import {renderRoutes} from "react-router-config";
import routes from "./routes";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {renderRoutes(routes)}
      </header>
    </div>
  );
}

export default App;
